  <script type="text/javascript">

    var letters = {
      connected:'card-header-success',
      disconnected:'card-header-danger'
    };

    function connectExchange(segment)
    {
      if(segment === "CM")
      {
        var path = 'login_cm';
      }

      if(segment === "FO")
      {
        var path = 'login_FO';
      }

      if(segment === "CD")
      {
        var path = 'login_CD';
      }

      $.get('/adapter',{
        path:path
      },function(data)
      {
        md.showNotification('bottom','left',data);
      });
    }

    function diconnectExchange(segment)
    {
      if(segment === "CM")
      {
        var path = 'logout_cm';
      }

      if(segment === "FO")
      {
        var path = 'logout_FO';
      }

      if(segment === "CD")
      {
        var path = 'logout_CD';
      }

      $.get('/adapter',{
        path:path
      },function(data)
      {
        md.showNotification('bottom','left',data);
      });
    }

    function getExchangeStatus()
    {
      $.post('/adapter',{
        path:'nse_cm_status'
      },function(data)
      {
        for(var index in letters)
        {
          $('.nsecm').removeClass(letters[index]);
        }

        var data = data.split("|");

        if(data[0] === 'connected')
        {
          $('#nsecm_orders').text(data[1]);
          $('#nsecm_status').text("CONNECTED");
          $('.nsecm').addClass(letters.connected);
        }
        else
        {
          $('#nsecm_orders').text(data[1]);
          $('#nsecm_status').text("DISCONNECTED");
          $('.nsecm').addClass(letters.disconnected);
        }
      });

      $.post('/adapter',{
        path:'nse_fo_status'
      },function(data)
      {
        for(var index in letters)
        {
          $('.nsefo').removeClass(letters[index]);
        }

        var data = data.split("|");

        if(data[0] === 'connected')
        {
          $('#nsefo_orders').text(data[1]);
          $('#nsefo_status').text("CONNECTED");
          $('.nsefo').addClass(letters.connected);
        }
        else
        {
          $('#nsefo_orders').text(data[1]);
          $('#nsefo_status').text("DISCONNECTED");
          $('.nsefo').addClass(letters.disconnected);
        }
      });

      $.post('/adapter',{
        path:'nse_cd_status'
      },function(data)
      {
        for(var index in letters)
        {
          $('.nsecd').removeClass(letters[index]);
        }

        var data = data.split("|");

        if(data[0] === 'connected')
        {
          $('#nsecd_orders').text(data[1]);
          $('#nsecd_status').text("CONNECTED");
          $('.nsecd').addClass(letters.connected);
        }
        else
        {
          $('#nsecd_orders').text(data[1]);
          $('#nsecd_status').text("DISCONNECTED");
          $('.nsecd').addClass(letters.disconnected);
        }
      });
    }

    getExchangeStatus();

    setInterval(function()
    {
      getExchangeStatus();
    },2000)

  </script>

